/** @format */

import React from "react";

import { useSelector } from "react-redux";
import { selectIsSignIn } from "../../slices/authenticate.slice";
import { Container, Row, Col, Image } from "react-bootstrap";
import SignIn from "../sign-in/sign-in.component";
import SignUp from "../sign-up/sign-up.component";

const Authenticate = () => {
  const isSignIn = useSelector(selectIsSignIn);
  return (
    <Container
      style={{
        marginTop: "175px",
      }}
    >
      <Row className="justify-content-center">
        <Col xs={10} sm={10} md={8} lg={8} xl={8}>
          <Image
            fluid
            src="https://images.unsplash.com/photo-1515003197210-e0cd71810b5f?ixid=MXwxMjA3fDB8MHxzZWFyY2h8MzB8fGZvb2R8ZW58MHx8MHw%3D&ixlib=rb-1.2.1&auto=format&fit=crop&w=800&q=60"
            rounded
          />
        </Col>
        <Col xs={12} sm={10} md={8} lg={4} xl={4}>
          {isSignIn ? <SignIn /> : <SignUp />}
        </Col>
      </Row>
    </Container>
  );
};

export default Authenticate;
